// src/InstagramFeed.js
import React, { useState, useEffect } from 'react';

const InstagramFeed = () => {
  const [posts, setPosts] = useState([]);
  const accessToken = 'IGAAbdym3lNvxBZAE5wZAXJLS1ROakRhLXpqbFBFeWlTZADZAwNlhNcmZAXM0ZAqb19vRzRmMVhxbGt3ZAkkyMDl2SC1YY2RXRF9aQTYyZAzBaRER6VDMtOXQ2MVJWS1lSLXNYVGxFUDgyMDBLVWtQM1YzcTJEWnhpekc5WFFPUlZA4MVVxdwZDZD'; // Replace with your actual access token

  useEffect(() => {
    const fetchInstagramPosts = async () => {
      const response = await fetch(`https://graph.instagram.com/me/media?fields=id,caption,media_url&access_token=${accessToken}`);
      const data = await response.json();
      setPosts(data.data);
    };

    fetchInstagramPosts();
  }, []);

  return (
    <div>
      {posts.map(post => (
        <div key={post.id}>
          <img src={post.media_url} alt={post.caption} />
          <p>{post.caption}</p>
        </div>
      ))}
    </div>
  );
};

export default InstagramFeed;
